import React from "react";

function ImagePopup({ cards, onClose, selectedCard }) {
    const className = `${selectedCard ? 'popup_opened' : '' }`;

    return (
      <div className={`popup popup_type_more-image ${className}`}>
        <div className="popup__container-image">
          <img src={cards.link} className="image" alt="Фото" />
            <button type="reset" className="popup__close" onClick={onClose}>
            </button>
          <p className="popup__title-image">{cards.name}</p>
        </div>
      </div>
    );
}

export default ImagePopup;


